import React from 'react';
import '../../styles/main/main.css';

function Main() {
  return (
        <div className="main">
            <div className='button__container'>
                <h3 className='button__left-title'>Annualy</h3>
                    <label class='button__switch'>
                        <input class='button__input' type="checkbox"/>
                        <div class='button__slider'></div>
                    </label>
                <h3 className='button__right-title'>Monthly</h3>
            </div>
            <h1>Main</h1>
        </div>
    );
}

export default Main;
